import React from 'react';
import Wrapper from '../components/Wrapper';
import styles from '../style/Home.module.css';
import bg from '../icons/bg.png';

export default function Home() {
    return (
        <Wrapper>
            <div>
                <div className={styles.video}>
                    <img src={bg} alt="bg" />
                </div>
            </div>
        </Wrapper>

    )
}
